contracts/SpringTenMarketplace.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/utils/Counters.sol";

contract SpringTenMarketplace is ReentrancyGuard, Ownable {
    using Counters for Counters.Counter;

    Counters.Counter private _itemIds;
    Counters.Counter private _itemsSold;

    uint256 public listingPrice = 0.025 ether; // 0.025 ETH listing fee

    struct MarketItem {
        uint256 itemId;
        address nftContract;
        uint256 tokenId;
        address seller;
        address owner;
        uint256 price;
        bool sold;
        bool isAuction;
        uint256 auctionEndTime;
        address highestBidder;
        uint256 highestBid;
    }

    mapping(uint256 => MarketItem) private idToMarketItem;
    mapping(address => uint256[]) private userListings;
    mapping(address => uint256[]) private userPurchases;

    event MarketItemCreated(
        uint256 indexed itemId,
        address indexed nftContract,
        uint256 indexed tokenId,
        address seller,
        address owner,
        uint256 price,
        bool isAuction
    );

    event MarketItemSold(
        uint256 indexed itemId,
        address indexed nftContract,
        uint256 indexed tokenId,
        address seller,
        address buyer,
        uint256 price
    );

    event BidPlaced(
        uint256 indexed itemId,
        address indexed bidder,
        uint256 amount
    );

    event AuctionEnded(
        uint256 indexed itemId,
        address indexed winner,
        uint256 winningBid
    );

    constructor() {
        _transferOwnership(msg.sender);
    }

    // Create a new market item (sale or auction)
    function createMarketItem(
        address nftContract,
        uint256 tokenId,
        uint256 price,
        bool isAuction,
        uint256 auctionDuration
    ) public payable nonReentrant {
        require(price > 0, "Price must be at least 1 wei");
        require(msg.value == listingPrice, "Price must be equal to listing price");

        _itemIds.increment();
        uint256 itemId = _itemIds.current();

        uint256 auctionEndTime = 0;
        if (isAuction) {
            auctionEndTime = block.timestamp + auctionDuration;
        }

        idToMarketItem[itemId] = MarketItem(
            itemId,
            nftContract,
            tokenId,
            msg.sender,
            address(this), // Marketplace owns the item initially
            price,
            false,
            isAuction,
            auctionEndTime,
            address(0),
            0
        );

        IERC721(nftContract).transferFrom(msg.sender, address(this), tokenId);
        userListings[msg.sender].push(itemId);

        emit MarketItemCreated(
            itemId,
            nftContract,
            tokenId,
            msg.sender,
            address(this),
            price,
            isAuction
        );
    }

    // Buy a market item
    function createMarketSale(uint256 itemId) public payable nonReentrant {
        MarketItem storage item = idToMarketItem[itemId];
        require(!item.sold, "Item already sold");
        require(!item.isAuction, "Item is in auction");
        require(msg.value == item.price, "Please submit the asking price");

        item.sold = true;
        item.owner = msg.sender;
        _itemsSold.increment();

        IERC721(item.nftContract).transferFrom(address(this), msg.sender, item.tokenId);
        payable(item.seller).transfer(msg.value);
        userPurchases[msg.sender].push(itemId);

        emit MarketItemSold(
            itemId,
            item.nftContract,
            item.tokenId,
            item.seller,
            msg.sender,
            item.price
        );
    }

    // Place a bid on an auction item
    function placeBid(uint256 itemId) public payable nonReentrant {
        MarketItem storage item = idToMarketItem[itemId];
        require(item.isAuction, "Item is not in auction");
        require(!item.sold, "Auction already ended");
        require(block.timestamp < item.auctionEndTime, "Auction has ended");
        require(msg.value > item.highestBid, "Bid must be higher than current highest bid");
        require(msg.sender != item.seller, "Seller cannot bid on own item");

        // Return previous highest bid
        if (item.highestBidder != address(0)) {
            payable(item.highestBidder).transfer(item.highestBid);
        }

        item.highestBidder = msg.sender;
        item.highestBid = msg.value;

        emit BidPlaced(itemId, msg.sender, msg.value);
    }

    // End an auction and transfer NFT to winner
    function endAuction(uint256 itemId) public nonReentrant {
        MarketItem storage item = idToMarketItem[itemId];
        require(item.isAuction, "Item is not in auction");
        require(!item.sold, "Auction already ended");
        require(block.timestamp >= item.auctionEndTime, "Auction has not ended yet");
        require(msg.sender == item.seller || msg.sender == owner(), "Only seller or owner can end auction");

        item.sold = true;
        item.owner = item.highestBidder;
        _itemsSold.increment();

        if (item.highestBidder != address(0)) {
            IERC721(item.nftContract).transferFrom(address(this), item.highestBidder, item.tokenId);
            payable(item.seller).transfer(item.highestBid);
            userPurchases[item.highestBidder].push(itemId);

            emit AuctionEnded(itemId, item.highestBidder, item.highestBid);
        } else {
            // No bids, return NFT to seller
            IERC721(item.nftContract).transferFrom(address(this), item.seller, item.tokenId);
        }
    }

    // Cancel a listing (only if no bids on auction)
    function cancelListing(uint256 itemId) public nonReentrant {
        MarketItem storage item = idToMarketItem[itemId];
        require(msg.sender == item.seller, "Only seller can cancel");
        require(!item.sold, "Item already sold");

        if (item.isAuction) {
            require(item.highestBidder == address(0), "Cannot cancel auction with bids");
        }

        item.sold = true;
        IERC721(item.nftContract).transferFrom(address(this), item.seller, item.tokenId);
    }

    // Fetch all unsold items
    function fetchMarketItems() public view returns (MarketItem[] memory) {
        uint256 itemCount = _itemIds.current();
        uint256 unsoldItemCount = _itemIds.current() - _itemsSold.current();
        uint256 currentIndex = 0;

        MarketItem[] memory items = new MarketItem[](unsoldItemCount);
        for (uint256 i = 0; i < itemCount; i++) {
            if (idToMarketItem[i + 1].owner == address(this)) {
                uint256 currentId = i + 1;
                MarketItem storage currentItem = idToMarketItem[currentId];
                items[currentIndex] = currentItem;
                currentIndex += 1;
            }
        }
        return items;
    }

    // Fetch user's listings
    function fetchUserListings(address user) public view returns (MarketItem[] memory) {
        uint256[] memory userItemIds = userListings[user];
        MarketItem[] memory items = new MarketItem[](userItemIds.length);

        for (uint256 i = 0; i < userItemIds.length; i++) {
            items[i] = idToMarketItem[userItemIds[i]];
        }
        return items;
    }

    // Fetch user's purchases
    function fetchUserPurchases(address user) public view returns (MarketItem[] memory) {
        uint256[] memory userItemIds = userPurchases[user];
        MarketItem[] memory items = new MarketItem[](userItemIds.length);

        for (uint256 i = 0; i < userItemIds.length; i++) {
            items[i] = idToMarketItem[userItemIds[i]];
        }
        return items;
    }

    // Update listing price (only owner)
    function updateListingPrice(uint256 _listingPrice) public onlyOwner {
        listingPrice = _listingPrice;
    }

    // Withdraw contract balance (only owner)
    function withdraw() public onlyOwner {
        payable(owner()).transfer(address(this).balance);
    }

    // Get contract balance
    function getBalance() public view returns (uint256) {
        return address(this).balance;
    }
}

contracts/SpringTenNFT.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Counters.sol";

contract SpringTenNFT is ERC721, ERC721URIStorage, ERC721Enumerable, Ownable {
    using Counters for Counters.Counter;

    Counters.Counter private _tokenIdCounter;

    // Base URI for metadata
    string private _baseTokenURI;

    // Collection info
    string public collectionName;
    string public collectionSymbol;
    uint256 public maxSupply;
    uint256 public mintPrice;
    bool public mintingActive;

    // Events
    event NFTMinted(address indexed to, uint256 indexed tokenId, string tokenURI);
    event BatchMinted(address indexed to, uint256[] tokenIds);
    event MintingToggled(bool active);
    event PriceUpdated(uint256 newPrice);

    constructor(
        string memory _name,
        string memory _symbol,
        uint256 _maxSupply,
        uint256 _mintPrice
    ) ERC721(_name, _symbol) {
        collectionName = _name;
        collectionSymbol = _symbol;
        maxSupply = _maxSupply;
        mintPrice = _mintPrice;
        mintingActive = true;
        _transferOwnership(msg.sender);
    }

    // Mint a single NFT
    function mintNFT(address to, string memory tokenURI) public payable returns (uint256) {
        require(mintingActive, "Minting is not active");
        require(msg.value >= mintPrice, "Insufficient payment");
        require(totalSupply() < maxSupply, "Max supply reached");
        require(to != address(0), "Cannot mint to zero address");

        uint256 tokenId = _tokenIdCounter.current();
        _tokenIdCounter.increment();

        _safeMint(to, tokenId);
        _setTokenURI(tokenId, tokenURI);

        // Refund excess payment
        if (msg.value > mintPrice) {
            payable(msg.sender).transfer(msg.value - mintPrice);
        }

        emit NFTMinted(to, tokenId, tokenURI);
        return tokenId;
    }

    // Mint multiple NFTs in a batch
    function batchMint(
        address to,
        string[] memory tokenURIs
    ) public payable returns (uint256[] memory) {
        require(mintingActive, "Minting is not active");
        require(msg.value >= mintPrice * tokenURIs.length, "Insufficient payment");
        require(totalSupply() + tokenURIs.length <= maxSupply, "Exceeds max supply");
        require(to != address(0), "Cannot mint to zero address");

        uint256[] memory tokenIds = new uint256[](tokenURIs.length);

        for (uint256 i = 0; i < tokenURIs.length; i++) {
            uint256 tokenId = _tokenIdCounter.current();
            _tokenIdCounter.increment();

            _safeMint(to, tokenId);
            _setTokenURI(tokenId, tokenURIs[i]);
            tokenIds[i] = tokenId;
        }

        // Refund excess payment
        uint256 totalCost = mintPrice * tokenURIs.length;
        if (msg.value > totalCost) {
            payable(msg.sender).transfer(msg.value - totalCost);
        }

        emit BatchMinted(to, tokenIds);
        return tokenIds;
    }

    // Owner can mint for free
    function ownerMint(address to, string memory tokenURI) public onlyOwner returns (uint256) {
        require(totalSupply() < maxSupply, "Max supply reached");
        require(to != address(0), "Cannot mint to zero address");

        uint256 tokenId = _tokenIdCounter.current();
        _tokenIdCounter.increment();

        _safeMint(to, tokenId);
        _setTokenURI(tokenId, tokenURI);

        emit NFTMinted(to, tokenId, tokenURI);
        return tokenId;
    }

    // Get all tokens owned by an address
    function getTokensByOwner(address owner) public view returns (uint256[] memory) {
        uint256 tokenCount = balanceOf(owner);
        uint256[] memory tokenIds = new uint256[](tokenCount);

        for (uint256 i = 0; i < tokenCount; i++) {
            tokenIds[i] = tokenOfOwnerByIndex(owner, i);
        }

        return tokenIds;
    }

    // Get token metadata
    function getTokenMetadata(uint256 tokenId) public view returns (string memory) {
        require(_exists(tokenId), "Token does not exist");
        return tokenURI(tokenId);
    }

    // Update base URI
    function setBaseURI(string memory baseURI) public onlyOwner {
        _baseTokenURI = baseURI;
    }

    // Toggle minting
    function toggleMinting() public onlyOwner {
        mintingActive = !mintingActive;
        emit MintingToggled(mintingActive);
    }

    // Update mint price
    function updateMintPrice(uint256 newPrice) public onlyOwner {
        mintPrice = newPrice;
        emit PriceUpdated(newPrice);
    }

    // Withdraw contract balance
    function withdraw() public onlyOwner {
        uint256 balance = address(this).balance;
        require(balance > 0, "No funds to withdraw");
        payable(owner()).transfer(balance);
    }

    // Override required functions for multiple inheritance
    function _beforeTokenTransfer(
        address from,
        address to,
        uint256 tokenId,
        uint256 batchSize
    ) internal override(ERC721, ERC721Enumerable) {
        super._beforeTokenTransfer(from, to, tokenId, batchSize);
    }

    function _burn(uint256 tokenId) internal override(ERC721, ERC721URIStorage) {
        super._burn(tokenId);
    }

    function tokenURI(uint256 tokenId)
        public
        view
        override(ERC721, ERC721URIStorage)
        returns (string memory)
    {
        return super.tokenURI(tokenId);
    }

    function supportsInterface(bytes4 interfaceId)
        public
        view
        override(ERC721, ERC721Enumerable, ERC721URIStorage)
        returns (bool)
    {
        return super.supportsInterface(interfaceId);
    }

    // Get contract info
    function getContractInfo() public view returns (
        string memory name,
        string memory symbol,
        uint256 totalSupplyCount,
        uint256 maxSupplyCount,
        uint256 price,
        bool active
    ) {
        return (
            collectionName,
            collectionSymbol,
            totalSupply(),
            maxSupply,
            mintPrice,
            mintingActive
        );
    }
}

contracts/SpringTenToken.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/token/ERC20/extensions/ERC20Burnable.sol";
import "@openzeppelin/contracts/token/ERC20/extensions/ERC20Pausable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";

contract SpringTenToken is ERC20, ERC20Burnable, ERC20Pausable, Ownable, ReentrancyGuard {
    uint256 public constant MAX_SUPPLY = 1000000000 * 10**18; // 1 billion tokens
    uint256 public constant INITIAL_SUPPLY = 100000000 * 10**18; // 100 million tokens

    // Staking rewards
    uint256 public stakingRewardRate = 10; // 10% APY
    uint256 public constant REWARD_PRECISION = 10000; // For percentage calculations

    // Staking struct
    struct Stake {
        uint256 amount;
        uint256 timestamp;
        uint256 lastClaimed;
        bool active;
    }

    mapping(address => Stake) public stakes;
    mapping(address => uint256) public stakingRewards;

    // Events
    event TokensStaked(address indexed user, uint256 amount, uint256 timestamp);
    event TokensUnstaked(address indexed user, uint256 amount, uint256 timestamp);
    event RewardsClaimed(address indexed user, uint256 amount);
    event TokensBurned(address indexed user, uint256 amount);

    constructor() ERC20("SpringTen Token", "SPRING") {
        _mint(msg.sender, INITIAL_SUPPLY);
        _transferOwnership(msg.sender);
    }

    // Mint new tokens (only owner)
    function mint(address to, uint256 amount) public onlyOwner {
        require(totalSupply() + amount <= MAX_SUPPLY, "Exceeds maximum supply");
        _mint(to, amount);
    }

    // Stake tokens
    function stake(uint256 amount) public nonReentrant whenNotPaused {
        require(amount > 0, "Amount must be greater than 0");
        require(balanceOf(msg.sender) >= amount, "Insufficient balance");

        // Claim any pending rewards first
        if (stakes[msg.sender].active) {
            claimRewards();
        }

        _transfer(msg.sender, address(this), amount);

        stakes[msg.sender] = Stake({
            amount: stakes[msg.sender].amount + amount,
            timestamp: block.timestamp,
            lastClaimed: block.timestamp,
            active: true
        });

        emit TokensStaked(msg.sender, amount, block.timestamp);
    }

    // Unstake tokens
    function unstake(uint256 amount) public nonReentrant {
        require(stakes[msg.sender].active, "No active stake");
        require(amount > 0, "Amount must be greater than 0");
        require(amount <= stakes[msg.sender].amount, "Insufficient staked amount");

        // Claim any pending rewards first
        claimRewards();

        stakes[msg.sender].amount -= amount;

        if (stakes[msg.sender].amount == 0) {
            stakes[msg.sender].active = false;
        }

        _transfer(address(this), msg.sender, amount);

        emit TokensUnstaked(msg.sender, amount, block.timestamp);
    }

    // Claim staking rewards
    function claimRewards() public nonReentrant {
        require(stakes[msg.sender].active, "No active stake");

        uint256 pendingRewards = calculatePendingRewards(msg.sender);
        require(pendingRewards > 0, "No rewards to claim");

        stakes[msg.sender].lastClaimed = block.timestamp;
        stakingRewards[msg.sender] += pendingRewards;

        // Mint new tokens for rewards
        _mint(msg.sender, pendingRewards);

        emit RewardsClaimed(msg.sender, pendingRewards);
    }

    // Calculate pending rewards for a user
    function calculatePendingRewards(address user) public view returns (uint256) {
        if (!stakes[user].active) return 0;

        uint256 timeElapsed = block.timestamp - stakes[user].lastClaimed;
        uint256 annualReward = (stakes[user].amount * stakingRewardRate) / 100;
        uint256 dailyReward = annualReward / 365;
        uint256 secondsInDay = 86400;

        return (dailyReward * timeElapsed) / secondsInDay;
    }

    // Get user's staking info
    function getStakingInfo(address user) public view returns (
        uint256 stakedAmount,
        uint256 pendingRewards,
        uint256 stakingStartTime,
        bool isActive
    ) {
        Stake memory userStake = stakes[user];
        return (
            userStake.amount,
            calculatePendingRewards(user),
            userStake.timestamp,
            userStake.active
        );
    }

    // Update staking reward rate (only owner)
    function updateStakingRate(uint256 newRate) public onlyOwner {
        require(newRate <= 1000, "Rate cannot exceed 10%"); // Max 10%
        stakingRewardRate = newRate;
    }

    // Pause token transfers (only owner)
    function pause() public onlyOwner {
        _pause();
    }

    // Unpause token transfers (only owner)
    function unpause() public onlyOwner {
        _unpause();
    }

    // Override required functions for multiple inheritance
    function _beforeTokenTransfer(
        address from,
        address to,
        uint256 amount
    ) internal override(ERC20, ERC20Pausable) {
        super._beforeTokenTransfer(from, to, amount);
    }

    // Burn tokens with additional functionality
    function burn(uint256 amount) public override {
        super.burn(amount);
        emit TokensBurned(msg.sender, amount);
    }

    // Emergency functions
    function emergencyWithdraw() public onlyOwner {
        uint256 balance = balanceOf(address(this));
        if (balance > 0) {
            _transfer(address(this), owner(), balance);
        }
    }
}

